import React from "react";

export default function SocialBar() {
  return (
    <div className="social-icons">
      <a class="icon-Facebook"></a>
      <a class="icon-Instagram"></a>
      <a class="icon-Twitter"></a>
      <a class="icon-Youtube"></a>
    </div>
  );
}
